import React from "react";
import style from "../styles/navbar.module.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className={style.container}>
      <Link to='/#home'>
        <h1 onClick={() => {
            window.location.replace("/")
        }}>Home</h1>
      </Link>

      <h1>About</h1>
      <h1>Skills</h1>
      <h1>Projects</h1>
      <h1>Contact</h1>
    </div>
  );
};

export default Navbar;
